  \"2016-07-27T23:04:37.516315\",\n\t\"name\": \"sandplain-gerardia-in-new-york-population-monitoring-habitat-management-and-recovery-2003-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This report outlines the results of continued
  monitoring and recovery efforts of the endangered Sandplain Gerardia and 2003 was
  an incredibly successful year. Numbers of the plant on Long Island increased to
  84,500 - 11 times higher than the previous record of 14,200 in 2001. Most of this
  increase was due to a 16-fold increase in seeded plots rather than to the average
  2.8-fold increase in the original, native populations. Another factor in this huge
  increase in 2003 was probably due to unusually high rainfall.\",\n\t\"license_title\":
